    def listCtrlData(self):
        #try:   #使用__file__需要在文件模式下
        if not os.path.exists(self.DataLoc):
            om.MGlobal.displayWarning(u'外部控制器数据不存在')
            return
        #except NameError:
        if os.path.isdir(self.DataLoc):
            fileList = os.listdir('%s/Json' %self.DataLoc)
            if fileList:
                cmds.gridLayout('%s_ctrlDataIcon_gL' %self.UiName, e=1, vis=1)
                for i in range(len(fileList)):
                    name = os.path.splitext(fileList[i])[0]
                    #fileN = fileList[i+1].split('.json')[0]
                    cmds.iconTextButton('%s_ctrl_DataIcon%s' %(self.UiName, i), i="%s/Icon/%s.jpg" %(self.DataLoc, name), p='%s_ctrlDataIcon_gL' %self.UiName, 
                                            c=lambda n=name: self.CreateCtrlCur(0, n))
                    cmds.popupMenu()
                    cmds.menuItem(l='Delete', c=lambda f, n=name, index=i: self.DeleteCtrlData(n, index))

    def ReadJsonData(self, fileName):
        with open('%s/Json/%s.json' %(self.DataLoc, fileName), 'r') as jsFile:
            readData = json.load(jsFile)
        return readData['degree'], readData['points'], readData['knot']

    def DeleteCtrlData(self, name, index):
        for i in ["%s/Icon/%s.jpg" %(self.DataLoc, name), "%s/Json/%s.json" %(self.DataLoc, name)]:
            if os.path.isfile(i):
                os.remove(i)
        cmds.iconTextButton('%s_ctrl_DataIcon%s' %(self.UiName, index), e=1, vis=0)
    
    def AddCtrlData(self):
        sl = cmds.ls(sl=1)
        if len(sl) != 1:
            om.MGlobal.displayError(u'只能选择一个控制器')
            return
        TimeName = time.strftime('%Y%m%d%H%M%S')

        #Data
        jsonDirt = {'degree': [], 'points': [], 'knot': []}
        for i in range(len(cmds.listRelatives(sl[0], c=1, s=1, typ='nurbsCurve'))):
            selList = om.MGlobal.getActiveSelectionList()
            MDagPath = selList.getDagPath(0)
            nurbsCurve = om.MFnNurbsCurve(MDagPath.extendToShape(i))
            jsonDirt['degree'].append(nurbsCurve.degree)
            jsonDirt['points'].append(cmds.getAttr('%s.controlPoints[*]' %MDagPath.extendToShape(i)))
            jsonDirt['knot'].append(list(nurbsCurve.knots()))

        #dataNum = int(os.listdir(self.DataLoc)[-1].split('.')[0][1:]) + 1
        with open('%s/Json/%s.json' %(self.DataLoc, TimeName), 'w') as jsFile:
            json.dump(jsonDirt, jsFile, indent=4, sort_keys=1)
        
        #Icon
        hud = []
        for i in cmds.headsUpDisplay(lh=1):
            hud.append([i, cmds.headsUpDisplay(i, q=1, vis=1)])
            cmds.headsUpDisplay(i, e=1, vis=0)
        panel = "control_model_panel"
        if not cmds.modelPanel(panel, ex=1):
            cmds.modelPanel(panel, tearOff=1, toc=1)
        cmds.modelEditor(panel, e=1, alo=0, nc=1, gr=False)
        cmds.setFocus(panel)
        cmds.setAttr("persp.r", 0,0,0)   #-30, 25, 0
        cmds.viewFit("persp", an=0)
        cmds.isolateSelect(panel, state=1)
        cmds.isolateSelect(panel, addSelected=1)
        
        #cmds.refresh(cv=1, fe="jpg", fn='%s/Icon/%s.jpg' %(self.DataLoc, TimeName))
        scshot = cmds.playblast(fmt="image", f='%s/Icon/aa' %self.DataLoc, c="jpg", wh=[128, 128], st=0, et=0, viewer=0, percent=100, quality=100, fp=1)
        os.rename(scshot.replace('aa.####.', 'aa.0.'), '%s/Icon/%s.jpg' %(self.DataLoc, TimeName))

        if cmds.modelPanel(panel, ex=1):
            cmds.deleteUI(panel, panel=True)
        for i in hud:
            cmds.headsUpDisplay(i[0], e=1, vis=i[1])
        cmds.select(cl=1)
        cmds.FrameSelectedWithoutChildrenInAllViews()
        
    def changeObjectColor(self, index=0):
        if index:
            cmds.intField('%s_colorSave' %self.UiName, e=1, v=index)
            cmds.frameLayout('%s_colorFrame' %self.UiName, e=1, bgc=cmds.colorIndex(index, q=1))
        SelObj = cmds.ls(sl=1, typ="transform")
        if not SelObj:
            return
        color = cmds.intField('%s_colorSave' %self.UiName, q=1, v=1)
        for ob in SelObj:
            objShape = cmds.listRelatives(ob, c=1, s=1)
            for sh in objShape:
                self.setShapeColor(sh, color)
        cmds.select(SelObj)

    def setShapeColor(self, shape, color):
        cmds.setAttr("%s.overrideEnabled" %shape, 1)
        #if type(color) == int:
        cmds.setAttr("%s.overrideRGBColors" %shape, 0)
        cmds.setAttr("%s.overrideColor" %shape, color)
        #else:
        #    cmds.setAttr("%s.overrideRGBColors" %sh, 1)
        #    cmds.setAttr("%s.overrideColorRGB" %sh, color[0], color[1], color[2])

    def CreateCtrlCur(self, local, Input):
        liteCtrl_Mode = cmds.checkBox('%s_liteCtrlCB' %self.UiName, q=1, v=1)
        Control_Mode = cmds.radioButtonGrp('%s_ControlRadio' %self.UiName, q=1, sl=1)
        repaceShape_Mode = cmds.checkBox('%s_repaceShapeCheck' %self.UiName, q=1, v=1)
        selectObj = cmds.ls(sl=1)

        if Input != 29:
            if local:
                D_degree = [1]
                D_points = [self.CtrlCurClass[Input-1][0]]
                D_knot = [self.CtrlCurClass[Input-1][1]]
            else:
                D_degree, D_points, D_knot = self.ReadJsonData(Input)

        ctrlName = cmds.textFieldGrp('%s_ctrlNameText' %self.UiName, q=1, tx=1) if cmds.textFieldGrp('%s_ctrlNameText' %self.UiName, q=1, tx=1) else None
        ctrlSuffix = cmds.textFieldGrp('%s_ctrlSuffixText' %self.UiName, q=1, tx=1) if cmds.textFieldGrp('%s_ctrlSuffixText' %self.UiName, q=1, tx=1) else '_Ctrl'
        OffsetSuffix = cmds.textFieldGrp('%s_offsetSuffixText' %self.UiName, q=1, tx=1) if cmds.textFieldGrp('%s_offsetSuffixText' %self.UiName, q=1, tx=1) else '_Offset'
        AniGroup = cmds.textFieldGrp('%s_aniSuffixText' %self.UiName, q=1, tx=1) if cmds.textFieldGrp('%s_aniSuffixText' %self.UiName, q=1, tx=1) else '_Ani'
        
        def grpRelatives(ctrl):
            #Ani组
            grp = cmds.group(ctrl, n='%s%s' %(ctrl, AniGroup))
            cmds.xform(grp, os=1, piv=[0, 0, 0])
            if not liteCtrl_Mode:
                #Drv组
                grp = cmds.group(grp, n='%s%s' %(ctrl, '_Drv'))
                cmds.xform(grp, os=1, piv=[0, 0, 0])
                #Con组
                grp = cmds.group(grp, n='%s%s' %(ctrl, '_Con'))
                cmds.xform(grp, os=1, piv=[0, 0, 0])
            #偏移组
            grp = cmds.group(grp, n='%s%s' %(ctrl, OffsetSuffix))
            cmds.xform(grp, os=1, piv=[0, 0, 0])
            return grp


        if not selectObj:   #在原点生成
            ###相同代码
            if Input == 29:
                cctrl = cmds.circle(nr=[0, 1, 0])[0]
            else:
                saveShape = []
                for i in range(len(D_degree)):
                    saveShape.append(cmds.curve(d=D_degree[i], p=D_points[i], k=D_knot[i]))
                for i in range(len(saveShape)-1):
                    self.addCurveShapeNode(saveShape[0], saveShape[i+1])
                    cmds.delete(saveShape[i+1])
                cctrl = saveShape[0]
                ###相同代码
            cctrl = self.nameIteration(cctrl, '%s%s' %(ctrlName, ctrlSuffix))
            self.changeObjectColor()
            grpRelatives(cctrl)
            cmds.select(cl=1)
        elif repaceShape_Mode == 0:   #正常生成
            ctrllist = []
            for everyObj in selectObj:
                nodeType = cmds.nodeType(everyObj)
                if not nodeType in ("transform", "joint", "ikHandle"):
                    continue
                ###相同代码
                if Input == 29:
                    cctrl = cmds.circle(nr=[0, 1, 0])[0]
                else:
                    saveShape = []
                    for i in range(len(D_degree)):
                        saveShape.append(cmds.curve(d=D_degree[i], p=D_points[i], k=D_knot[i]))
                    for i in range(len(saveShape)-1):
                        self.addCurveShapeNode(saveShape[0], saveShape[i+1])
                        cmds.delete(saveShape[i+1])
                    cctrl = saveShape[0]
                    ###相同代码
                cctrl = cmds.rename(cctrl, '%s%s' %(everyObj, ctrlSuffix)) if not ctrlName\
                            else self.nameIteration(cctrl, '%s%s' %(ctrlName, ctrlSuffix))
                self.changeObjectColor()
                cctrlGp = grpRelatives(cctrl)
                cmds.matchTransform(cctrlGp, everyObj, pos=1, rot=1)
                if Control_Mode == 2:
                    mode = cmds.checkBoxGrp('%s_ConstrainlCB' %self.UiName, q=1, va4=1)
                    if mode[0]:
                        cmds.parentConstraint(cctrl, everyObj, mo=1, weight=1)
                    if mode[1]:
                        cmds.pointConstraint(cctrl, everyObj, mo=1, weight=1)
                    if mode[2]:
                        cmds.orientConstraint(cctrl, everyObj, mo=1, weight=1)
                    if mode[3]:
                        cmds.scaleConstraint(cctrl, everyObj, offset=(1, 1, 1), weight=1)
                elif Control_Mode == 3:
                    cmds.parent(everyObj, cctrl)
                elif Control_Mode == 4:
                    Tv = cmds.getAttr("%s.translate" %everyObj)
                    Rv = cmds.getAttr("%s.rotate" %everyObj)
                    Sv = cmds.getAttr("%s.scale" %everyObj)
                    if Tv[0] == (0, 0, 0) and Rv[0] == (0, 0, 0) and Sv[0] == (1.0, 1.0, 1.0):
                        cmds.connectAttr("%s.t" %cctrl, "%s.t" %everyObj, f=1)
                        cmds.connectAttr("%s.r" %cctrl, "%s.r" %everyObj, f=1)
                        cmds.connectAttr("%s.s" %cctrl, "%s.s" %everyObj, f=1)
                    else:
                        cmds.select(selectObj)
                        om.MGlobal.displayError(u"属性连接控制时 %s的各属性应该默认" %everyObj)
                        return
                if cmds.checkBox('%s_parentCheck' %self.UiName, q=1, v=1):
                    ctrllist.append(cctrl)
            for i in range(len(ctrllist)-1, 0, -1):
                cmds.parent('%s%s' %(ctrllist[i], OffsetSuffix), ctrllist[i-1])
            cmds.select(selectObj)
        else:   #替换形状
            for o in selectObj:
                if Input == 29:
                    self.replaceCurveShapeNode(o, cmds.circle(nr=[0, 1, 0])[0])
                else:
                    for i in range(len(D_degree)):
                        newCurve = cmds.curve(d=D_degree[i], p=D_points[i], k=D_knot[i])
                        if i == 0:
                            self.replaceCurveShapeNode(o, newCurve)
                        else:
                            self.addCurveShapeNode(o, newCurve)
                        cmds.delete(newCurve)
            cmds.select(selectObj)

    def addCurveShapeNode(self, parent=None, shape=None):
        if not parent:
            sel = cmds.ls(sl=1)
            if len(sel) < 2:
                om.MGlobal.displayError(u"先选要加进去的形状，后选要添加到的物体")
                return
        else:
            sel = (shape, parent)

        nShapeList = cmds.listRelatives(sel[0], c=1, s=1, type="nurbsCurve")
        for trans in sel[1:]:
            for _shape in nShapeList:
                _dup = cmds.duplicateCurve(_shape, ch=0)[0]
                _dupShape = cmds.listRelatives(_dup, c=1, s=1, type="nurbsCurve")[0]   #不复制会共用一个Shape
                cmds.parent(_dupShape, trans, add=1, s=1)
                cmds.delete(_dup)
                if cmds.getAttr('%s.overrideEnabled' %_shape):
                    self.setShapeColor(_dupShape, cmds.getAttr('%s.overrideColor' %_shape))
                self.nameIteration(_dupShape, "%sShape" %trans)
        cmds.select(parent)

    def replaceCurveShapeNode(self, old=None, shape=None):
        if not old:
            sel = cmds.ls(sl=1)
            if len(sel) < 2:
                om.MGlobal.displayError(u"先选要被替换的物体，最后选替进去的形状")
                return
        else:
            sel = (shape, old)
        
        for i in sel[1:]:
            oShapeList = cmds.listRelatives(i, c=1, s=1, type="nurbsCurve")
            sets = cmds.listConnections(oShapeList[0], t='objectSet')
            cmds.delete(oShapeList, s=1)
            self.addCurveShapeNode(i, sel[0])
            if sets:
                for s in sets:
                    cmds.sets(oShapeList[0], add=s)
        cmds.select(old)

    def nameIteration(self, oldN, NewN):
        i = 1
        Nas = NewN
        while cmds.objExists(Nas):
            Nas = '%s%s' %(NewN, i)
            i = i+1
        newName = cmds.rename(oldN, Nas)

        shapeNode = cmds.listRelatives(newName, s=1, c=1)
        if shapeNode:
            for i in shapeNode:
                if len(cmds.ls(i)) > 1:
                    cmds.rename('%s|%s' %(newName, i), '%saShape' %i)
        return newName

    def curScale_Rot(self, Conditions):
        sel = cmds.ls(sl=1, typ="transform")
        if len(sel) == 0:
            return
        if type(Conditions) == float:
            oldint = 1   #cmds.intField('%s_saveScaleValue' %self.UiName, q=1, v=1)
            for ob in sel:
                piv = cmds.xform(ob, q=1, ws=1, rp=1)
                for sh in cmds.listRelatives(ob, children=True, s=1, type="nurbsCurve"):
                    Num = cmds.getAttr("%s.controlPoints" %sh, s=1) - 1
                    allShape = "%s.cv[0:%s]" %(sh, Num)
                    if Conditions > oldint:
                        cmds.scale(1.1, 1.1, 1.1, allShape, r=1, ocp=1, p=(piv[0], piv[1], piv[2]))
                    elif Conditions < oldint:
                        cmds.scale(0.9, 0.9, 0.9, allShape, r=1, ocp=1, p=(piv[0], piv[1], piv[2]))
            #cmds.intField('%s_saveScaleValue' %self.UiName, e=1, v=Conditions)
        else:
            for ob in sel:
                piv = cmds.xform(ob, q=1, ws=1, rp=1)
                for sh in cmds.listRelatives(ob, children=True, s=1, type="nurbsCurve"):
                    Num = cmds.getAttr("%s.controlPoints" %sh, s=1) - 1
                    allShape = "%s.cv[0:%s]" %(sh, Num)
                    if Conditions == "X45":
                        cmds.rotate(45, 0, 0, allShape, r=1, ocp=1, os=1, p=(piv[0], piv[1], piv[2]))
                    elif Conditions == "Y45":
                        cmds.rotate(0, 45, 0, allShape, r=1, ocp=1, os=1, p=(piv[0], piv[1], piv[2]))
                    elif Conditions == "Z45":
                        cmds.rotate(0, 0, 45, allShape, r=1, ocp=1, os=1, p=(piv[0], piv[1], piv[2]))
                    elif Conditions == "XSc":
                        cmds.scale(-1, 1, 1, allShape, r=1, ocp=1, p=(piv[0], piv[1], piv[2]))
                    elif Conditions == "YSc":
                        cmds.scale(1, -1, 1, allShape, r=1, ocp=1, p=(piv[0], piv[1], piv[2]))
                    elif Conditions == "ZSc":
                        cmds.scale(1, 1, -1, allShape, r=1, ocp=1, p=(piv[0], piv[1], piv[2]))
        cmds.select(sel)

    def addNamefix(self, mode):
        sllist = cmds.ls(sl=1, typ="transform")
        if not sllist:
            return
        if mode == 'Pre':
            if cmds.promptDialog(t=u'添加前缀', tx='prefix_', b=['OK', 'Cancel'], db='OK', cb='Cancel', ds='Cancel') == 'OK':
                text = cmds.promptDialog(q=1, t=1)
                for i in reversed(sllist):
                    cmds.rename(i, '%s%s' %(text, i.rsplit('|', 1)[-1]))
        elif mode == 'Suf':
            if cmds.promptDialog(t=u'添加后缀', tx='_suffix', b=['OK', 'Cancel'], db='OK', cb='Cancel', ds='Cancel') == 'OK':
                text = cmds.promptDialog(q=1, t=1)
                for i in reversed(sllist):
                    cmds.rename(i, '%s%s' %(i.rsplit('|', 1)[-1], text))

    def mirrorCtrl(self, mode):
        sel = cmds.ls(sl=1, typ="transform")
        if len(sel) != 2:
            om.MGlobal.displayError(u"先选做好的, 再选被镜像的")
            return
        Shape = cmds.listRelatives(sel[0], c=1, s=1, type="nurbsCurve")
        if not Shape:
            om.MGlobal.displayError(u"先选做好的, 再选被镜像的")
            return
        dupObj = cmds.duplicate(sel[0], rr=1)
        souShape = cmds.listRelatives(sel[0], c=1, s=1, type="nurbsCurve")
        newShape = cmds.listRelatives(dupObj, c=1, s=1, type="nurbsCurve")
        cmds.delete(cmds.listRelatives(sel[1], c=1, s=1, type="nurbsCurve"), s=1)
        if not mode:
            for ss, ns in zip(souShape, newShape):
                nName = cmds.parent(cmds.rename(ns, '%s01Shape' %sel[1]), sel[1], add=1, s=1)[0]
                sscv = cmds.ls('%s.cv[*]' %ss, fl=1)
                for n in range(len(sscv)):
                    _ssT = cmds.xform(sscv[n], q=1, ws=1, t=1)
                    cmds.xform('%s.cv[%s]' %(nName, n), ws=1, t=(_ssT[0] * -1, _ssT[1], _ssT[2]))
        else:
            for ss, ns in zip(souShape, newShape):
                nName = cmds.parent(cmds.rename(ns, '%s01Shape' %sel[1]), sel[1], add=1, s=1)[0]
        cmds.delete(dupObj)

